query BidFlowConfirmBidScreenRendererQuery(
  $saleArtworkID: String!
) {
  sale_artwork(id: $saleArtworkID) {
    ...ConfirmBid_sale_artwork
    __id
  }
}

fragment ConfirmBid_sale_artwork on SaleArtwork {
  artwork {
    title
    date
    artist_names
    __id
  }
  lot_label
  __id
}
